import React from "react";
import {Link } from "react-router-dom";

const Layout = () => {
  return (
    <>
     <h1> Documents</h1>
      <nav>
        <ul>
            <Link to="/SampleDoc1"><li>SampleDocument1.pdf</li></Link>
            <Link to="/SampleDoc1"><li>SampleDocument2.pdf</li></Link>
            <Link to="/SampleDoc3"><li>SampleDocument3.pdf</li></Link>
          
          
        </ul>
      </nav>

      
    </>
  )
};

export default Layout;
